- input: "TEXT\x1CC00448696\x1C1\x1C\x1CF3XA\x1CDue to issues with the filing software,
    the origianl report did not include several disbursements, the candidate detail
    for all of the independent expenditures, or the memo entries detailing each earmark
    transmital.  This amendment fully discloses all activity. All contributions noted
    as EM indicate a contribution received by the Senate Conservatives Fund that was
    earmarked for a specific candidate.  The candidate name is noted and the date
    of transmittal to each candidate is noted.  The matching transmittal checks are
    itemized on line 23.  All contributions noted as CONDUIT are contributions received
    for specific candidates and forwarded directly to each recipient committee--these
    were not deposited by the Senate Conservatives Fund.  All contributions aggregating
    over $200 calendar year to date with incomplete employer/occupation have received
    requests for additional information.  Per instructions from the FEC, the adjusting
    entry on line 21b balances the IE payments made to Senate Conservatives Fund for
    CC processing fees. As directed by the FEC, the memo entries to Senate Conservatives
    Fund on Schedule E are not debt owed by the committee, but disclose the use of
    the SCF email list as there is no direct cost to SCF. \n"
